import * as React from 'react';
import instalogo from "./assets/instagram-logo.png"
import { Route, Routes } from "react-router";
import { Link } from "react-router-dom";
import Divider from '@mui/material/Divider';
import ListItemButton from '@mui/material/ListItemButton';
import Home from '@mui/icons-material/Home';
import Search from '@mui/icons-material/Search';
import Explore from '@mui/icons-material/Explore';
import Reels from '@mui/icons-material/Slideshow';
import Messages from '@mui/icons-material/Chat';
import Notification from '@mui/icons-material/FavoriteBorder';
import CreatePost from '@mui/icons-material/AddCard';
import Menu from '@mui/icons-material/Menu';


function Leftbar() {

  return (
<div className='leftbar'>
  <img id="insta" src={instalogo} alt="instalogo" width={"100px"} />
  <Divider />
  <Link to="/">
      <ListItemButton>
        <h2 id="but"><Home fontSize='small'/> Home</h2>
      </ListItemButton>
      </Link>

      <Link to="/posts">
      <ListItemButton>

      <h2 id="but"><Search fontSize='small'/> Search</h2>
      </ListItemButton>

      </Link>
      <ListItemButton>
        <h2 id="but"> <Explore fontSize='small'/> Explore</h2>
      </ListItemButton>
      <ListItemButton>
        <h2 id="but"> <Reels fontSize='small'/> Reels</h2>
      </ListItemButton>

      <ListItemButton>
      <h2 id="but"><Messages fontSize='small'/> Messages</h2>
      </ListItemButton>

      <ListItemButton>
        <h2 id="but"> <Notification fontSize='small'/> Notification</h2>
      </ListItemButton>
      <ListItemButton>
        <h2 id="but"> <CreatePost fontSize='small'/> CreatePost</h2>
      </ListItemButton>
      <ListItemButton>
        <h2 id="Menu"> <Menu fontSize='small'/> Menu</h2>
      </ListItemButton>


  <Divider />
  <Routes>

            <Route path="/" element={<Home />}>
              <Route index element={<PostsList />} />
              <Route path="add" element={<AddPost />} />
              <Route path="delete" element={<DeletePost />} />
              <Route path=":postId" element={<PostDetails />} />
            </Route>

            <Route path="*" element={<NotFound />} />
          </Routes>
</div>


  );
}



export default Leftbar;
